colours = dict()


n = int(input())
for i in range(n):
    t = input()

    if t not in colours:
        colours[t] = 0

    colours[t] += 1


max_amount = 0
colour = ""


for k, v in colours.items():
    if v > max_amount:
        max_amount = v
        colour = k
    elif v == max_amount:
        colour = "Multiple"


print(colour, max_amount)
